import { CardContent } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      <div style={{ width: '980px', display: 'flex' }}>
        {card.map((e, i) => (
          <p>{e.title}</p>
        ))}
      </div>
    </>
  )
}
